import React, { useState, useEffect } from "react";
import { Navbar } from "../index";
import "./Pickup.css";

function Pickup() {
  const [formData, setFormData] = useState({
    parcel: "0",
    pickupDate: "",
    pickupTime: "0",
    pickupLocation: "",
    province: "0",
  });

  const [locations, setLocations] = useState([]);

  useEffect(() => {
    // Fetch data when the component mounts
    fetch("/pickup")
      .then((response) => {
        if (response.ok) {
          return response.json();
        }
        throw new Error("Failed to fetch data");
      })
      .then((data) => {
        // Assuming data is an array of location objects with id and name properties
        setLocations(data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []); // Empty dependency array ensures this effect runs only once, on mount

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSelectorChange = (e) => {
    const { name, value } = e.target;
    this.setState({ [name]: value });

    // Update data object with the selected value
    const data = { ...this.state };
    data[name] = value;

    // Now you can use this data object when submitting to the backend
    this.setState({ data }); // Optionally, you can set the updated data in state
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    fetch("http://localhost:3333/pickup", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (response.ok) {
          console.log("Data submitted successfully");
          setFormData({
            parcel: "0",
            pickupDate: "",
            pickupTime: "0",
            pickupLocation: "",
            province: "0",
          });
        } else {
          console.error("Failed to submit data");
        }
      })
      .catch((error) => {
        console.error("Error occurred:", error);
      });
  };

  return (
    <div>
      <Navbar />
      <div class="Pickup-container" id="container">
        <div className="Pickup-form-container">
          <form>
            <h1 className="header">Pickup request</h1>
            <span>select location and date for pickup service</span>
            <br />
            <br />

            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Select parcel</span>
              </label>
              <div class="enterdata">
                <select
                  name="parcel"
                  value={formData.parcel}
                  onChange={handleSelectorChange}
                >
                  {locations.map((location) => (
                    <option key={location.parcel_ID} value={location.parcel_ID}>
                      {location.parcel_ID} {/* Display parcel ID */}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup date</span>
              </label>
              <div class="enterdata">
                <input type="date" />
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup time</span>
              </label>
              <div class="enterdata">
                <select id="selector">
                  <option value="0">10:00 - 13:00</option>
                  <option value="1">13:00 - 15:00</option>
                  <option value="2">15:00 - 17:00</option>
                </select>
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup location detail</span>
              </label>
              <div class="enterdata">
                <input
                  type="Address details"
                  placeholder="Enter address details"
                />
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">
                  Provinces/District/Sub-district/zip code
                </span>
              </label>
              <div class="enterdata">
                <select id="selector">
                  <option value="0">BKK</option>
                  <option value="1">Samut prakarn</option>
                </select>
              </div>
            </div>
            <br />
            <button onClick={handleSubmit}>submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Pickup;
